import React, {Component} from 'react';

class TodoList extends Component {
    render() {
        return (
            <div className={"container"}>
                <div className="bg-dark col-12">
                </div>
                <div className="bg-danger col-12">
                </div>
            </div>
        )
    }
}

export default TodoList;
